吉乃川のロゴの入ったオリジナルグラスです。<br>
香りが少しずつ立ち、グラスの中に香りがこもりやすい形になっているため吟醸酒や大吟醸酒などの香りのある日本酒を楽しむのに最適です。<br><br>

